import React from "react";
import { Fname } from "./App";
import { Lname } from "./App";

function ComC(){
    return(
        <>
        <Fname.Consumer>
            {
                (value)=>{
                    return (
                        <Lname.Consumer>
                            {
                                (lname)=>{
                                   return (<p>My name is {value} {lname} </p>)
                                }
                            }
                        </Lname.Consumer>
                    )
                }
            }
        </Fname.Consumer>
        <h2>Jhukega Nahi Salla</h2>
        </>
    )
}
export default ComC;
